                <h1>IPL Dashboard</h1>    
            </div>

            <div>
                <h3><Link to = {'/'}>Home</Link></h3>
            </div>

            <div>
                <h3><Link to = {'/season/2022'}>Season</Link></h3>
            </div>

        </div>
    );

}

export default Header;
